import React, { Component } from "react";
import { Button, View, Text } from "react-native";
import {
  Table,
  TableWrapper,
  Row,
  Rows,
  Col,
  Cols,
  Cell,
} from "react-native-table-component";

import courseList from "./data/courses.json";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      courseList: courseList,
      HeadTable: ["Name", "Preis", "Beschreibung"],
      DataTable: [
        ["1", "2", "3"],
        ["a", "b", "c"],
        ["1", "2", "3"],
        ["a", "b", "c"],
        ["1", "2", "3"],
      ],
    };
  }

  render() {
    const state = this.state;
    const courseList = this.state.courseList.map((fitness) => [
      fitness.id,
      fitness.name,
      fitness.price,
      fitness.description,
    ]);
    return (
      <View>
        <Table borderStyle={{ borderWidth: 1, borderColor: "#ffa1d2" }}>
          <Row
            data={state.HeadTable}
            // style={styles.HeadStyle}
            // textStyle={styles.TableText}
          />
          {courseList.map((fitness, index) => (
            <Row
              key={index}
              data={fitness}
              //widthArr={this.state.widthArr}
              //style={[styles1.row, index%2 && {backgroundColor: '#F7F6E7'}]}
              //textStyle={styles1.text}
            />
          ))}
        </Table>
      </View>
    );
  }
}

export default Fitnessinfo;

